module('lively.morphic.tools.LoadingIndicator').requires('lively.persistence.BuildSpec').toRun(function() {

lively.BuildSpec('lively.morphic.LoadingIndicator', {
    _Extent: lively.pt(128.0,128.0),
    _Fill: Color.rgba(131,131,131,0.95),
    _StyleSheet: ".Morph .closeButton {\n\
	visibility: hidden;\n\
	text-align: right;\n\
	margin-right: 0px;\n\
	font-size: 12px;\n\
	color: white;\n\
}\n\
\n\
.Morph:hover .closeButton {\n\
	visibility: visible;\n\
	cursor: pointer;\n\
}",
    className: "lively.morphic.Image",
    doNotSerialize: ["_whenLoadedCallbacks", "whenOpenedInWorldCallbacks"],
    droppingEnabled: false,
    isEpiMorph: true,
    name: "LoadingIndicator",
    sourceModule: "lively.morphic.Widgets",
    submorphs: [{
        _Align: "center",
        _ClipMode: "hidden",
        _Extent: lively.pt(128.0,26.0),
        _FontFamily: "Arial, sans-serif",
        _FontSize: 11,
        _HandStyle: "default",
        _InputAllowed: false,
        _IsSelectable: false,
        _Padding: lively.rect(5,5,0,0),
        _Position: lively.pt(0.0,52.0),
        _TextColor: Color.rgb(255,255,255),
        _WhiteSpaceHandling: "pre",
        allowInput: false,
        className: "lively.morphic.Text",
        eventsAreIgnored: true,
        isLabel: true,
        name: "Text",
        sourceModule: "lively.morphic.TextCore",
        textString: "Loading..."
    }, {
        _ClipMode: "hidden",
        _Extent: lively.pt(20.0,20.0),
        _FontFamily: "Helvetica",
        _HandStyle: "default",
        _InputAllowed: false,
        _IsSelectable: false,
        _Padding: lively.rect(4,2,0,0),
        _Position: lively.pt(108.0,0.0),
        _StyleClassNames: ["closeButton"],
        _TextColor: Color.rgb(64,64,64),
        _TextStylingMode: true,
        allowInput: false,
        className: "lively.morphic.Text",
        draggingEnabled: false,
        droppingEnabled: false,
        evalEnabled: false,
        fixedHeight: true,
        fixedWidth: true,
        grabbingEnabled: false,
        layout: {moveHorizontal: true},
        name: "closeButton",
        sourceModule: "lively.morphic.TextCore",
        textString: "âœ—",
        onMouseUp: function onMouseUp() { this.owner.remove(); }
    }],
    url: "data:image/gif;base64,",
    onFromBuildSpecCreated: function onFromBuildSpecCreated() {
        $super();
        this.whenOpenedInWorld(function() {
            this.setPositionCentered(this.world().visibleBounds().extent().scaleBy(0.5));
        });
    },
    setLabel: function setLabel(text) { this.get('Text').textString = text; }
});

Object.extend(lively.morphic.tools.LoadingIndicator, {
    open: function(label, doFunc) {
        var loadingIndicator = lively.BuildSpec('lively.morphic.LoadingIndicator').createMorph().openInWorld();
        if (arguments.length === 1) doFunc = label;
        else loadingIndicator.setLabel(label);
        doFunc && doFunc(function closeLoadingIndicator() { loadingIndicator.remove(); });
        return loadingIndicator;
    }
});

}) // end of module
